import React from "react";
import Input from "../components/Input";

function IndexPage() {
  return (
    <>
      <Input type="text" />
      <Input type="password" />
      <Input type="email" />
      <Input type="search" />
      <Input type="password" />
    </>
  );
}

export default IndexPage;
